import React, { useEffect, useState } from "react";

import Box from "@mui/material/Box";
import Breadcrumbs from "@mui/material/Breadcrumbs";
import MaterialLink from "@mui/material/Link";
import Stack from "@mui/material/Stack";
import Typography from "@mui/material/Typography";
import Footer from "../Footer/Footer";

import DataTable from "../DataTable/DataTable";

import { useTheme } from "@mui/material/styles";

import { Link, useNavigate, useParams } from "react-router-dom";
import useAuth from "../../hook/useAuth";

import { getDetailInvoice } from "../../api/invoice";
import { getDateString, getDateStringWithWeekday } from "../../helper/date";

const tableHeaders = ["No", "Course Name", "Type", "Schedule", "Price"];

const DetailInvoicePage = () => {
  const theme = useTheme();
  const gray2 = theme.palette.gray2.main;
  const gray3 = theme.palette.gray3.main;

  const navigate = useNavigate();
  const { id } = useParams();
  const { user, isValidatingToken } = useAuth();

  const [invoice, setInvoice] = useState({});
  const [courses, setCourses] = useState([]);

  useEffect(() => {
    if (isValidatingToken) return;
    if (!user) {
      navigate("/");
      return;
    }

    getDetailInvoice(id)
      .then((res) => {
        const data = res.data;
        setInvoice(data.invoice);
        setCourses(data.purchased_courses);
      })
      .catch((err) => {
        const res = err?.response;

        if (res?.status === 403) {
          navigate("/");
        }
      });
  }, [user, isValidatingToken, id]);

  const textStyle = {
    fontSize: "1.125rem",
    fontWeight: "500",
  };

  const boldTextStyle = {
    ...textStyle,
    fontWeight: "700",
  };

  return (
    <div>
      <Stack
        spacing="42px"
        sx={{
          width: "1140px",
          margin: "0 auto",
          marginTop: "46px",
          marginBottom: "304px",
        }}
      >
        <Stack spacing="36px">
          <Breadcrumbs separator=">" sx={{ color: gray3, fontWeight: "600" }}>
            <MaterialLink
              component={Link}
              underline="hover"
              to="/"
              sx={{ color: gray3, fontWeight: "600" }}
            >
              Home
            </MaterialLink>
            <MaterialLink
              component={Link}
              underline="hover"
              to="/invoice"
              sx={{ color: gray3, fontWeight: "600" }}
            >
              Invoice
            </MaterialLink>
            <Typography
              paragraph={true}
              color="primary"
              sx={{ margin: "0", fontWeight: "600" }}
            >
              Details Invoice
            </Typography>
          </Breadcrumbs>

          <Stack spacing="30px">
            <Typography
              variant="h6"
              component="h1"
              sx={{ color: gray2, textAlign: "left", fontWeight: "700" }}
            >
              Details Invoice
            </Typography>

            <Stack
              direction="row"
              sx={{ justifyContent: "space-between", color: gray2 }}
            >
              <Box
                sx={{
                  display: "grid",
                  gridTemplateColumns: "130px 265px",
                  gap: "8px 24px",
                  textAlign: "left",
                }}
              >
                <Typography sx={textStyle}>No. Invoice :</Typography>
                <Typography sx={textStyle}>{invoice.no_invoice}</Typography>

                <Typography sx={textStyle}>Date :</Typography>
                <Typography sx={textStyle}>
                  {invoice.date && getDateString(invoice.date)}
                </Typography>
              </Box>

              <Stack direction="row" spacing={3} sx={{ alignSelf: "flex-end" }}>
                <Typography sx={boldTextStyle}>Total Price</Typography>
                <Typography sx={boldTextStyle}>
                  {invoice.total_price &&
                    `IDR ${invoice.total_price.toLocaleString("id")}`}
                </Typography>
              </Stack>
            </Stack>
          </Stack>
        </Stack>

        <DataTable
          headers={tableHeaders}
          rows={courses.map((course, index) => [
            index + 1,
            course.name,
            course.category_name,
            getDateStringWithWeekday(course.schedule),
            `IDR ${course.price.toLocaleString("id")}`,
          ])}
          maxWidth="100%"
        />
      </Stack>

      <Footer />
    </div>
  );
};

export default DetailInvoicePage;
